INSERT INTO `ex_coin_copy1` VALUES ('Bitcoin', 0, 1, 1, 1, 0, 1, 0, 0.01, 5.00000000, 0.001, 0.00200000, '比特币', 2, 0, 'BTC', 0, 0.10000000, b'0', '', 0.00002000, 4, '比特币（BitCoin）一的概念最初由中本聪在2008年提出，根据中本聪的思路设计发布的开源软件以及建构其上的P2P网络。比特币是一种P2P形式的数字货币。点对点的传输意味着一个去中心化的支付系统。', 'The concept of Bitcoin (BitCoin) was originally proposed by Satoshi Nakamoto in 2008, and the open source software designed and released according to the ideas of Satoshi Nakamoto and the P2P network built on it. Bitcoin is a P2P form of digital currency. Peer-to-peer transmission means a decentralized payment system.', 'Khái niệm Bitcoin (BitCoin) ban đầu được Satoshi Nakamoto đề xuất vào năm 2008, phần mềm mã nguồn mở được thiết kế và phát hành theo ý tưởng của Satoshi Nakamoto và mạng P2P được xây dựng trên đó. Bitcoin là một dạng tiền tệ kỹ thuật số P2P. Truyền ngang hàng có nghĩa là một hệ thống thanh toán phi tập trung.', 'https://bitcoin.org/bitcoin.pdf', 1, '3PZCVMDGe2S4UUtyDo95R2WyEwXdx9sTQ9', 0.10000000, 0, 'The concept of Bitcoin (BitCoin) was originally proposed by Satoshi Nakamoto in 2008, and the open source software designed and released according to the ideas of Satoshi Nakamoto and the P2P network built on it. Bitcoin is a P2P form of digital currency. Peer-to-peer transmission means a decentralized payment system.', 'Khái niệm Bitcoin (BitCoin) ban đầu được Satoshi Nakamoto đề xuất vào năm 2008, phần mềm mã nguồn mở được thiết kế và phát hành theo ý tưởng của Satoshi Nakamoto và mạng P2P được xây dựng trên đó. Bitcoin là một dạng tiền tệ kỹ thuật số P2P. Truyền ngang hàng có nghĩa là một hệ thống thanh toán phi tập trung.');
INSERT INTO `ex_coin_copy1` VALUES ('EOS', 0, 0, 1, 0, 1, 0, 0, 0.001, 1000.00000000, 0.001, 1.00000000, '柚子', 5, 0, 'EOS', 6.5, 0.00100000, b'0', '', NULL, 4, 'EOS是区块链奇才BM（Daniel Larimer）领导开发的类似操作系统的区块链架构平台，旨在实现分布式应用的性能扩展。EOS 提供帐户，身份验证，数据库，异步通信以及在数以百计的CPU或群集上的程序调度。', 'EOS is an operating system-like blockchain architecture platform developed by blockchain wizard BM (Daniel Larimer), which aims to realize the performance expansion of distributed applications. EOS provides accounts, authentication, databases, asynchronous communication, and program scheduling on hundreds of CPUs or clusters.', 'EOS là một nền tảng kiến trúc blockchain giống hệ điều hành được phát triển bởi thuật sĩ blockchain BM (Daniel Larimer), nhằm mục đích hiện thực hóa việc mở rộng hiệu suất của các ứng dụng phân tán. EOS cung cấp tài khoản, xác thực, cơ sở dữ liệu, giao tiếp không đồng bộ và lập lịch chương trình trên hàng trăm CPU hoặc cụm.', 'https://eos.io/', 0, '', 0.01000000, 0, 'EOS is an operating system-like blockchain architecture platform developed by blockchain wizard BM (Daniel Larimer), which aims to realize the performance expansion of distributed applications. EOS provides accounts, authentication, databases, asynchronous communication, and program scheduling on hundreds of CPUs or clusters.', 'EOS là một nền tảng kiến trúc blockchain giống hệ điều hành được phát triển bởi thuật sĩ blockchain BM (Daniel Larimer), nhằm mục đích hiện thực hóa việc mở rộng hiệu suất của các ứng dụng phân tán. EOS cung cấp tài khoản, xác thực, cơ sở dữ liệu, giao tiếp không đồng bộ và lập lịch chương trình trên hàng trăm CPU hoặc cụm.');
INSERT INTO `ex_coin_copy1` VALUES ('Ethereum', 0, 1, 1, 1, 0, 1, 0, 0.2, 1000.00000000, 0.01, 0.10000000, '以太坊', 5, 0, 'ETH', 0, 0.01000000, b'0', '', NULL, 8, 'Ethereum（以太坊）是一个平台和一种编程语言，使开发人员能够建立和发布下一代分布式应用。 Ethereum可以用来编程，分散，担保和交易任何事物：投票，域名，金融交易所，众筹，公司管理， 合同和大部分的协议，知识产权，还有得益于硬件集成的智能资产。', 'Ethereum (Ethereum) is a platform and a programming language that enables developers to build and publish the next generation of distributed applications. Ethereum can be used to program, decentralize, secure and trade anything: voting, domain names, financial exchanges, crowdfunding, corporate governance, contracts and most agreements, intellectual property, and smart assets that benefit from hardware integration.', 'Ethereum (Ethereum) là một nền tảng và một ngôn ngữ lập trình cho phép các nhà phát triển xây dựng và xuất bản thế hệ tiếp theo của các ứng dụng phân tán. Ethereum có thể được sử dụng để lập trình, phân quyền, bảo mật và giao dịch bất kỳ thứ gì: bỏ phiếu, tên miền, trao đổi tài chính, huy động vốn từ cộng đồng, quản trị công ty, hợp đồng và hầu hết các thỏa thuận, sở hữu trí tuệ và tài sản thông minh được hưởng lợi từ tích hợp phần cứng.', 'https://ethereum.org/en/', 1, '0x52719ba6894ef5699a32e0a0221a371a9dab981a', 0.01000000, 0, 'Ethereum (Ethereum) is a platform and a programming language that enables developers to build and publish the next generation of distributed applications. Ethereum can be used to program, decentralize, secure and trade anything: voting, domain names, financial exchanges, crowdfunding, corporate governance, contracts and most agreements, intellectual property, and smart assets that benefit from hardware integration.', 'Ethereum (Ethereum) là một nền tảng và một ngôn ngữ lập trình cho phép các nhà phát triển xây dựng và xuất bản thế hệ tiếp theo của các ứng dụng phân tán. Ethereum có thể được sử dụng để lập trình, phân quyền, bảo mật và giao dịch bất kỳ thứ gì: bỏ phiếu, tên miền, trao đổi tài chính, huy động vốn từ cộng đồng, quản trị công ty, hợp đồng và hầu hết các thỏa thuận, sở hữu trí tuệ và tài sản thông minh được hưởng lợi từ tích hợp phần cứng.');
INSERT INTO `ex_coin_copy1` VALUES ('USDT', 0, 1, 1, 1, 7, 1, 0, 5000, 5000.00000000, 1, 10.00000000, '泰达币', 100, 0, 'USDT', 1, 1.00000000, b'0', '', NULL, 8, 'USDT是Tether公司推出的基于稳定价值货币美元（USD）的代币Tether USD（下称USDT），1USDT=1美元，用户可以随时使用USDT与USD进行1:1兑换。Tether公司严格遵守1:1准备金保证，即每发行1个 USDT 代币，其银行账户都会有1美元的资金保障。', 'USDT is a token Tether USD (hereinafter referred to as USDT) based on the stable value currency U.S. dollar (USD) launched by Tether. 1USDT=1 USD, and users can use USDT to exchange 1:1 with USD at any time. Tether strictly abides by the 1:1 reserve guarantee, that is, for every USDT token issued, its bank account will have 1 USD of funds guaranteed.', 'USDT là một token Tether USD (sau đây gọi là USDT) dựa trên đơn vị tiền tệ có giá trị ổn định là Đô la Mỹ (USD) do Tether phát hành. 1USDT = 1 USD và người dùng có thể sử dụng USDT để trao đổi 1: 1 với USD bất kỳ lúc nào. Tether tuân thủ nghiêm ngặt bảo đảm dự trữ 1: 1, nghĩa là đối với mỗi mã thông báo USDT được phát hành, tài khoản ngân hàng của nó sẽ có 1 USD tiền được đảm bảo.', 'https://tether.to/wp-content/uploads/2016/06/TetherWhitePaper.pdf', 1, 'TK1c7VtKhBpEC46mgXDcZbjrkCXiFdi38m', 1.00000000, 0.001, 'USDT is a token Tether USD (hereinafter referred to as USDT) based on the stable value currency U.S. dollar (USD) launched by Tether. 1USDT=1 USD, and users can use USDT to exchange 1:1 with USD at any time. Tether strictly abides by the 1:1 reserve guarantee, that is, for every USDT token issued, its bank account will have 1 USD of funds guaranteed.', 'USDT là một token Tether USD (sau đây gọi là USDT) dựa trên đơn vị tiền tệ có giá trị ổn định là Đô la Mỹ (USD) do Tether phát hành. 1USDT = 1 USD và người dùng có thể sử dụng USDT để trao đổi 1: 1 với USD bất kỳ lúc nào. Tether tuân thủ nghiêm ngặt bảo đảm dự trữ 1: 1, nghĩa là đối với mỗi mã thông báo USDT được phát hành, tài khoản ngân hàng của nó sẽ có 1 USD tiền được đảm bảo.');
