  `symbol` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '交易对',
  `coin_scale` int(0) NULL DEFAULT NULL COMMENT '币种小数位(没有用到，所有币种都是保存8位小数)',
  `enable_market_buy` int(0) NULL DEFAULT 1 COMMENT '0:取消市价开仓做多 1: 市价开仓做多(没有用到)',
  `enable_market_sell` int(0) NULL DEFAULT 1 COMMENT '0:取消市价开仓做空 1:市价开仓做空(没有用到)',
  `enable_open_buy` int(0) NULL DEFAULT 1 COMMENT '0:取消开仓做多 1:开仓做多(没有用到)',
  `enable_open_sell` int(0) NULL DEFAULT 1 COMMENT '0::取消开仓做空 1:开仓做空(没有用到)',
  `enable_trigger_entrust` int(0) NULL DEFAULT 1 COMMENT '0:取消开仓计划委托1:开仓计划委托(没有用到)',
  `exchangeable` int(0) NULL DEFAULT 1 COMMENT '0:禁止交易 1:启动交易(没有用到)',
  `close_fee` decimal(18, 8) NULL DEFAULT 0.00010000 COMMENT '平仓手续费(没有用到)',
  `leverage` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '杠杆倍率',
  `fee_percent` decimal(18, 8) NULL DEFAULT 0.00100000 COMMENT '资金费率',
  `interval_hour` int(0) NULL DEFAULT 1 COMMENT '资金费用结算时间间隔(没有用到)',
  `leverage_type` int(0) NULL DEFAULT 1 COMMENT '杠杆类型(没有用到)',
  `maintenance_margin_rate` decimal(18, 8) NULL DEFAULT 0.00500000 COMMENT '维持保证金率(没有用到)',
  `maker_fee` decimal(18, 8) NULL DEFAULT 0.00010000 COMMENT '平多手续费(没有用到)',
  `max_share` decimal(18, 8) NULL DEFAULT 1000.00000000 COMMENT '最大手数(没有用到)',
  `min_share` decimal(18, 8) NULL DEFAULT 1.00000000 COMMENT '最小手数(没有用到)',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '名字',
  `open_fee` decimal(18, 8) NULL DEFAULT 0.00010000 COMMENT '开仓手续费(没有用到)',
  `share_number` decimal(18, 8) NULL DEFAULT NULL COMMENT '单位手数(没有用到)',
  `spread` decimal(18, 8) NULL DEFAULT NULL COMMENT '点差(没有用到)',
  `spread_type` int(0) NULL DEFAULT 1 COMMENT '点差类型(没有用到)',
  `taker_fee` decimal(18, 8) NULL DEFAULT 0.00010000 COMMENT '平台手续费(用新的统计表)',
  `total_close_fee` decimal(26, 8) NULL DEFAULT NULL COMMENT '合约总平仓手续费(用新的统计表)',
  `total_loss` decimal(26, 8) NULL DEFAULT NULL COMMENT '合约平台亏损(用新的统计表)',
  `total_open_fee` decimal(26, 8) NULL DEFAULT NULL COMMENT '合约总开仓手续费(用新的统计表)',
  `total_profit` decimal(26, 8) NULL DEFAULT NULL COMMENT '合约平台盈利(用新的统计表)',
  `type` int(0) NULL DEFAULT 0 COMMENT '合约类型 0-U本位，1-币本位',
  `sort` int(0) NULL DEFAULT NULL COMMENT '排序',
  `popular` int(0) NULL DEFAULT NULL COMMENT '0:未热门 1:热门',
  `visible` int(0) NULL DEFAULT 1 COMMENT '0:未可见 1:前端可见',
  `enable` int(0) NULL DEFAULT 1 COMMENT '0:未开启 1:开启采集',
  `status` int(0) NULL DEFAULT 1 COMMENT '0:删除 1：有效',
  `create_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 155 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '合约-币种采集对列表' ROW_FORMAT = COMPACT;

