  `order_resource` int(0) NULL DEFAULT NULL COMMENT '订单来源：ROBOT-机器人，CUSTOMER-用户，API-接口',
  `currency_wallet_id` bigint(0) NULL DEFAULT NULL COMMENT '币币钱包Id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `memberId_index`(`member_id`) USING BTREE,
  INDEX `coinId_index`(`coin_id`) USING BTREE,
  INDEX `currencyWalletId_index`(`currency_wallet_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 490 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '币币交易委托单' ROW_FORMAT = COMPACT;

