  `update_by` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '更新者',
  `create_by` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '创建者',
  `first_level` int(0) NULL DEFAULT NULL COMMENT '一级',
  `second_level` int(0) NULL DEFAULT NULL COMMENT '二级',
  `third_level` int(0) NULL DEFAULT NULL COMMENT '三级',
  `login_count` int(0) NULL DEFAULT NULL COMMENT '登陆次数',
  `publish_advertise` int(0) NULL DEFAULT NULL COMMENT '发布广告  1表示可以发布',
  `sign_in_ability` int(0) NULL DEFAULT NULL COMMENT '签到能力',
  `total_recharge_amount` decimal(18, 4) NULL DEFAULT NULL COMMENT '累计充值',
  `total_bet_amount` decimal(18, 4) NULL DEFAULT NULL COMMENT '累计打码量',
  `total_withdraw_amount` decimal(18, 4) NULL DEFAULT NULL COMMENT '累计提现',
  `bet_scale` decimal(18, 2) NULL DEFAULT NULL COMMENT '打码量比例',
  `lower_number` int(0) NULL DEFAULT NULL COMMENT '下级人数',
  `agen_relation_id` bigint(0) NULL DEFAULT NULL COMMENT '代理id',
  `agen_relation_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '代理商账户',
  `test` int(0) NULL DEFAULT 0 COMMENT '测试账户',
  `member_grade_id` int(0) NULL DEFAULT NULL COMMENT '等级id',
  `member_grade_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '等级名称',
  `lower_direct_number` int(0) NULL DEFAULT NULL COMMENT '直接邀请人数',
  `lower_indirect_number` int(0) NULL DEFAULT NULL COMMENT '间接邀请人数',
  `gesture` int(0) NULL DEFAULT 0 COMMENT '手势登陆：1开启0关闭',
  `gesture_password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手势登陆密码',
  `default_language` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '当前语言',
  `default_legal` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '默认法币',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `username`(`username`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 104 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员表信息表' ROW_FORMAT = DYNAMIC;

